      out.write("가. 소비자 피해 보상 규정에 의거하여 작업물 원본의 멸실 및 작업 기간 미이행 및 이에 상응하는 전문가 책임으로 인한 피해 발생 시, 전액 환불 \r\n");
      out.write("나. 시안 작업 진행된 상품 차감 환불\r\n");
